import React from 'react';
import { StyleSheet} from 'react-native';

export const styles = StyleSheet.create({
  container: {
    flex: 1,
    width: "280px",
    backgroundColor: '#fff',
    alignItems: 'center',
    justifyContent: 'center',
  },
  consumer: {
    width: 280,
    height: 40,
    backgroundColor: '#8FD7D3',
  },
});
